import React from "react";

import Home from "../containers/Home";
import Login from "../containers/Login";

const PublicRoutes = {
  "/": () => <Home />,
  "/login": () => <Login />,
  "*": () => <div>Error 404. Page not found.</div>,
};

export default PublicRoutes;
